import ExpenseItem from "./components/ExpenseItem";

function App() {
  const expences = [
    { title: "Car Insurance", amount: "10000", date: new Date(2021, 2, 28) },
    { title: "Toilet Paper", amount: "10000", date: new Date(2021, 2, 28) },
    { title: "New TV", amount: "10000", date: new Date(2021, 2, 28) },
    { title: "Car Insurance", amount: "10000", date: new Date(2021, 2, 28) },
  ];
  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem title={expences[0].title} amount={expences[0].amount} ></ExpenseItem>
    </div>
  );
}

export default App;
